wow i had a revelation.&nbsp;
i have a satisfying contentment with everything.
today i didn't feel like wearing shoes, so i didn't. it was great!
and now even my bad photog skills don't bring me down, rather i am now looking foward to photog and my gnome photos.

this is strange behaviour.&nbsp;
school's pretty freaking great. everything's great. next weekend i'm going out on&nbsp;friday&nbsp;and going to belle and sebastian on saturday.&nbsp;
eveyone at school thinks i'm some perfect good person. i love it.&nbsp;

my maths teacher gave me a freddo today- one of the really good ones with white chocolate AND normal chocolate. 


oh man things are too good. my bubble is going to burst pretty fucking soon eh?
